import React from "react";
import Popup from "reactjs-popup";

class EditWindow extends React.Component {
  state = { data: [] };

  render() {
    return (
      <div>
        <Popup trigger={<button className="ui button">Add New</button>} modal>
          {close => (
            <div className="modal">
              <div className="ui header"> Add New </div>
              <div className="content">

              </div>
              <div className="actions">
                <button
                  className="button"
                  onClick={() => {
                    console.log("Save");
                    /* this is where I would pass the data up somewhere*/
                    close();
                  }}
                >
                  Save
                </button>

                <button
                  className="button"
                  onClick={() => {
                    console.log("Cancel");
                    close();
                  }}
                >
                  Cancel
                </button>
              </div>
            </div>
          )}
        </Popup>
      </div>
    );
  }
}

export default EditWindow;
